using System;
using System.Collections.Generic;
using System.Drawing;
using System.IO;
using System.Runtime.Serialization.Formatters.Binary;

namespace LiveSplit.SuperMetroid
{
    class Images : Dictionary<String, List<Image>>
    {
        public Images()
        {
            Add("Energy Tank", "");
            Add("Reserve Tank", "");
            Add("Missiles", "");
            Add("Super Missiles", "");
            Add("Power Bombs", "");
            Add("Varia Suit", "");
            Add("Gravity Suit", "");
            Add("Morph Ball", "");
            Add("Bombs", "");
            Add("Spring Ball", "");
            Add("High Jump Boots", "");
            Add("Speed Booster", "");
            Add("Space Jump", "");
            Add("Screw Attack", "");
            Add("Grapple Beam", "");
            Add("X-Ray Scope", "");
            Add("Charge Beam", "");
            Add("Spazer", "");
            Add("Ice Beam", "");
            Add("Wave Beam", "");
            Add("Plasma Beam", "");
            Add("Kraid", "");
            Add("Phantoon", "");
            Add("Draygon", "");
            Add("Ridley", "");
        }
        private void Add(String name, String base64Image)
        {
            try
            {
                List<Image> images = new List<Image>();

                //Bitmap image = new BinaryFormatter().Deserialize(new MemoryStream(Convert.FromBase64String(base64Image))) as Bitmap;

                Bitmap image;
                var bf = new BinaryFormatter();
                var data = Convert.FromBase64String(base64Image);

                using (var ms = new MemoryStream(data))
                {
                    image = (Bitmap)bf.Deserialize(ms);
                    for (int i = 0; i < image.Width / image.Height; ++i)
                    {
                        images.Add(image.Clone(new Rectangle((i * image.Height), 0, image.Height, image.Height), image.PixelFormat));
                    }
                }

                Add(name, images);
            }
            catch (Exception) { }
        }
    }
}
